// Load verovio on demand
// it will queue all the calls so all the incipits
// are rendered when verovio is loaded and ready

var vrvToolkit = null;

var deferred_render_data = []
var verovio_loading = false;

function finalize_verovio () {
	verovio_loading = false
	vrvToolkit = new verovio.toolkit();
	
	for (var i = 0; i < deferred_render_data.length; i++) {
	    data = deferred_render_data[i];
		render_music(data.music, data.format, data.target, data.width);
	}
}

function load_verovio() {
	if (verovio_loading == true) {
		return;
	}
	
	verovio_loading = true;
	
	var element = document.createElement("script");
	element.src = "/javascripts/verovio-toolkit.js";
	document.body.appendChild(element);
	
    element.onreadystagechange = finalize_verovio;
    element.onload = finalize_verovio;

}

// This is the helper function to call to render 
// an incipit into a target div. It will do the preloading
// in the background
function render_music( music, format, target, width ) {	
	width = typeof width !== 'undefined' ? width : 720;
	
	if (vrvToolkit == null) {
		deferred_render_data.push({
			music: music, 
			format: format, 
			target: target, 
			width: width});
			
		load_verovio();
		return;
	}
	
	options = {
				inputFormat: 'pae',
				pageMarginTop: 40,
				pageMarginBottom: 60,
				pageMarginLeft: 20,
				pageMarginRight: 20,
				pageWidth: width / 0.4,
				spacingStaff: 1,
				scale: 40,
				adjustPageHeight: 1
			};
			
	vrvToolkit.setOptions( options );
	vrvToolkit.loadData(music + "\n" );
	svg = vrvToolkit.renderToSVG(1, {});
	
	$(target).html(svg);
};

var _nw_destination = null;
var _child = null;
var _interval = null;

function deselectSession() {
	$.ajax({
		success: function(data) {},
		data: {
			deselect: true, 
		},
		dataType: 'script',
		timeout: 20000,
		type: 'get',
		url: '/admin/session/deselect', 
	});
}

function newWindowUpdateValue(id, label) {
	
	deselectSession();
	$("#wrapper").unblock();
	
	if (_nw_destination == null)
		return;
	
	var field = _nw_destination.data("field")
	
	// Get the autocomplete
	toplevel_li = _nw_destination.parents("li");
	ac = toplevel_li.find(".autocomplete_new_window");
	
	_nw_destination.addClass("serialize_marc");
	var element_class = marc_editor_validate_className(_nw_destination.data("tag"), _nw_destination.data("subfield"));
	_nw_destination.addClass(element_class);
	// Write the data
	if (_nw_destination.data("has-links-to") == false) {
		// Normal autocomplete writes the ID of the linked resource in the hidden
		_nw_destination.val(id);
	} else {
		// links-to need the TEXT not the id
		_nw_destination.val(label);
	}
	_nw_destination.data("status", "selected");
	
	ac.removeClass("serialize_marc");
	ac.removeClass("new_autocomplete");
	
	// Remove the checkbox
	var check_tr = toplevel_li.find(".checkbox_confirmation")
	check_tr.fadeOut("fast");
	
	var check = toplevel_li.find(".creation_checkbox")
	check.data("check", false)
	
	// set the value of the AC by hand
	ac.val(label);
	
	_nw_destination = null;
	_child = null
}

// This function is called when
// a user navigates away from the parent
function newWindowClose() {

	deselectSession();
	_child.close();
	_nw_destination = null;
	_child = null;
}

function newWindowCancel() {

	deselectSession();
	$("#wrapper").unblock();
	_nw_destination = null;
	_child = null;
}

function newWindowUnloaded() {
	
	// Someone changed page on the
	// child window or it was closed
	// wait a bit and see if it was
	// really closed
	
	setTimeout(function() { 
		if (_child && _child.closed) {
			newWindowCancel();
		}
	}, 700)
}


function newWindowIsSelect() {
	if (_nw_destination != null)
		return true;
	else
		return false;
}


